        <tr>\r\n          <td width=\"10\">&nbsp;</td>\r\n          <td width=\"180\">&nbsp;</td>\r\n          <td width=\"10\">&nbsp;</td>\r\n        </tr>\r\n      </table>\r\n      \r\n    </td>\r\n    <td align=\"left\" valign=\"bottom\" width=\"254\"><a href=\"http://www.vieillescharrues.asso.fr/festival/index.php\"><img src=\"http://www.vieillescharrues.asso.fr/festival/media/fest_home01.gif\" width=\"254\" height=\"148\" vspace=\"0\" hspace=\"0\" border=\"0\"></a></td>\r\n    <td width=\"146\">&nbsp;</td>\r\n  </tr>\r\n  <tr> \r\n    <td align=\"left\" valign=\"top\" width=\"200\"> \r\n      <table width=\"200\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n        <tr> \r\n          <td width=\"10\">&nbsp;</td>\r\n          <td width=\"180\" class=\"textecourant01\">&nbsp;</td>\r\n          <td width=\"10\">&nbsp;</td>\r\n        </tr>\r\n        <tr> \r\n          <td width=\"10\">&nbsp;</td>\r\n          <td width=\"180\" align=\"center\" valign=\"top\" class=\"textecourant02\"><br>\r\n          </td>\r\n          <td width=\"10\">&nbsp;</td>\r\n        </tr>\r\n        <tr> \r\n          <td width=\"10\">&nbsp;</td>\r\n          <td width=\"180\" align=\"center\" valign=\"top\" class=\"textecourant02\">&nbsp;</td>\r\n          <td width=\"10\">&nbsp;</td>\r\n        </tr>\r\n      </table>\r\n      <br>\r\n      <br>\r\n      <table width=\"200\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n        <tr> \r\n          <td width=\"10\">&nbsp;</td>\r\n          <td width=\"180\" class=\"textecourant01\">&nbsp;</td>\r\n          <td width=\"10\">&nbsp;</td>\r\n        </tr>\r\n        <tr> \r\n          <td width=\"10\" height=\"100\">&nbsp;</td>\r\n          <td width=\"180\" align=\"center\" valign=\"top\" class=\"textecourant02\" height=\"100\">&nbsp;</td>\r\n          <td width=\"10\" height=\"100\">&nbsp;</td>\r\n        </tr>\r\n        <tr> \r\n          <td width=\"10\">&nbsp;</td>\r\n          <td width=\"180\" class=\"textecourant01\">&nbsp;</td>\r\n          <td width=\"10\">&nbsp;</td>\r\n        </tr>\r\n      </table>\r\n    </td>\r\n    <td align=\"left\" valign=\"top\" width=\"254\" bgcolor=\"#ECBD13\"> \r\n      <table width=\"254\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n        <tr> \r\n          <td width=\"10\">&nbsp;</td>\r\n          <td width=\"234\" class=\"textecourant02\"><P class=MsoHeader><B><SPAN style=\"FONT-SIZE: 12pt; FONT-FAMILY: Arial\"><FONT face=arial,geneva,sans-serif size=2>Bonjour,</FONT></SPAN></B>\r\n<P class=MsoHeader><B><SPAN style=\"FONT-SIZE: 12pt; FONT-FAMILY: Arial\"></SPAN></B>&nbsp;</td>\r\n          <td width=\"10\">&nbsp;</td>\r\n        </tr>\r\n        <tr> \r\n          <td width=\"10\">&nbsp;</td>\r\n          <td width=\"234\" class=\"textecourant02\" align=\"left\" valign=\"top\"> <b>Un \r\n            millier de personnes s\'est réuni cet après-midi dans les rues de Quimper \r\n            à l\'appel du collectif des associations carhaisiennes</b>, créé samedi \r\n            dernier, et de nombreux festivals bretons. <br>\r\n            Les Vieilles Charrues, par la voix d\'un de ses deux co-présidents, \r\n            Jean-Philippe Quignon, a une nouvelle fois demandé au gouvernement \r\n            et aux partenaires sociaux le retrait de l\'accord adopté le 26 juin \r\n            par l\'UNEDIC. Vous disposez de l\'intégralité du message lu par Jean-Philippe \r\n            Quignon (lien ci-dessous)<br>\r\n            Une motion a ensuite été déposée au Préfet du Finistère par une délégation \r\n            composée de responsables de festivals, d\'élus et de responsables associatifs. \r\n            Le texte de cette motion est également disponible en lien ci-dessous. \r\n            <br>\r\n            <br>\r\n            A très bientôt. <br>\r\n            L\'équipe des Vieilles Charrues <br>\r\n            <br>\r\n            <a href=\"http://www.vieillescharrues.asso.fr/telechargement/presse/Infos_VieillesCharrues-8juillet03.doc\" target=\"_blank\" class=\"liensouligne\">Le \r\n            Message de Jean Philippe Quignon co-pr&eacute;sident de l\'association</a> \r\n            (document word) <br>\r\n            <br>\r\n            <a href=\"http://www.vieillescharrues.asso.fr/telechargement/presse/motion_du_collectif.doc\" target=\"_blank\" class=\"liensouligne\">La \r\n            motion d&eacute;pos&eacute;e au Pr&eacute;fet par le collectif de \r\n            Carhaix.</a><br>\r\n            (document word) <br>\r\n            <br>\r\n            <a href=\"http://www.vieillescharrues.asso.fr\" class=\"liensouligne\">http://www.vieillescharrues.asso.fr<br>\r\n            <br>\r\n            </a> </td>\r\n          <td width=\"10\">&nbsp;</td>\r\n        </tr>\r\n      </table>\r\n    </td>\r\n    <td width=\"146\" align=\"center\" valign=\"bottom\"> \r\n      <table width=\"134\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n        <tr> \r\n          <td width=\"10\">&nbsp;</td>\r\n          <td class=\"textecourant01\"><font color=\"#FFFFFF\">Conform&eacute;ment \r\n            &agrave; l\'article 34 de la loi n&deg;78-17 du 6 janvier 1978 relative \r\n            &agrave; l\'informatique, aux fichiers et aux libert&eacute;s, vous \r\n            disposez d\'un droit d\'acc&egrave;s, de rectification et de suppression \r\n            des donn&eacute;es nominatives vous concernant. <br>\r\n            <br>\r\n            Les droits d\'acc&egrave;s et de rectification s\'exercent aupr&egrave;s \r\n            du <a href=\"mailto:webmaster@vieillescharrues.asso.fr\" class=\"cartouche02jaune_fest2003\">&nbsp;webmaster&nbsp;</a> \r\n            <br>\r\n            ou pour vous d&eacute;sinscrire en ligne <br>\r\n            <a href=\"http://www.vieillescharrues.asso.fr/actualites/mailing.php?email=pylb@wanadoo.fr&action=Supprimer mon email\"\r\n class=\"cartouche02jaune_fest2003\" target=\"_blank\">&nbsp;cliquez ici !&nbsp;</a><br>\r\n            <br>\r\n            Le pr&eacute;sent site a fait l\'objet d\'une d&eacute;claration &agrave; \r\n            la CNIL. </font></td>\r\n          <td width=\"10\">&nbsp;</td>\r\n        </tr>\r\n      </table>\r\n    </td>\r\n  </tr>\r\n  <tr> \r\n    <td align=\"left\" valign=\"top\" width=\"200\">&nbsp;</td>\r\n    <td align=\"left\" valign=\"top\" width=\"254\">&nbsp;</td>\r\n    <td width=\"146\">&nbsp;</td>\r\n  </tr>\r\n</table>\r\n</body>\r\n</html>\r\n','',0,2,NULL,0,0),(5,'2003-07-18','',NULL,'camemberts','<head>\r\n                <style TYPE=\"text/css\">\r\n                A:visited {text-decoration:none; font-family: Arial, Helvetica, sans-serif;}\r\n                A:hover {text-color:#CCCCCC; text-decoration:none;}\r\n                A:link {text-color:#CCCCCC; text-decoration:none;}\r\n                p {font-family: Arial, Helvetica, sans-serif;}\r\n                div {font-family: Arial, Helvetica, sans-serif; font-size: 11; font-color: black;}\r\n                td {font-family: Arial, Helvetica, sans-serif; font-size: 11; font-color: black;}\r\n                input {font-family: Arial, Helvetica, sans-serif; font-size: 11; font-color: black;}\r\n                select {font-family: Arial, Helvetica, sans-serif; font-size: 11; font-color: black;}\r\n		body {color: #000000}\r\n                </style>\r\n                <meta http-equiv=\"Content-Type\" content=\"text/html; charset=iso-8859-15\">\r\n</head>\r\n\r\n<center>\r\nselect num_commande \'N° commande\', round(prix_unitaire*quantite*(1-remise)/6.55957, 2) \'Montant TTC Euro\' from details_commandes group by num_commande order by prix_unitaire*quantite*(1-remise) desc limit 10<table>\r\n	<tr>\r\n		<td align=\"center\" valign=\"middle\">\r\n			<h1>Les 10 plus grosses commandes pass&eacute;es (camembert)</h1>\r\n			<img src=\"camembert.png\">\r\n			<img src=\"camembert_legend.png\">\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td align=\"center\" valign=\"middle\">\r\n			<h1>Les 10 plus grosses commandes pass&eacute;es (histogramme)